    <div>
      <>
        {!currentUser ? (
          <>
            <LoginHome />
            <SignupHome />
          </>
        ) : (
          <Button 
          style={{
            width: "420px",
            height: "70px",
            border: "solid",
            borderColor: "white",
            color: "white",
            fontSize: "24px",
            padding: "2px",
            marginRight: "10px"
        }} component={Link} to="/kayak">
